import React from 'react';
import Style from './app.module.scss';

import LogoLarge from './assets/logo_large.png';
import LogoSmall from './assets/logo_small.png';
import BannerOne from './assets/banner1.jpg';

function App() {
	return (
		<div className={Style.App}>
			<div className={Style.Header}>
				<img className={Style.LogoSmall} src={LogoSmall} alt='Find Firm LLC logo' />
			</div>
			<section className={Style.SlidingBanner}>
				<img className={Style.LogoLarge} src={LogoLarge} alt='Find Firm logo' />
			</section>
			<section className={Style.Contact}></section>
		</div>
	);
}

export default App;
